import React from 'react'
import { Grid, Typography } from '@mui/material'

const Contact = () => {
  return (
    <Grid container>
      <Typography align="center">This is centered text.</Typography>
      <Typography
        variant="h4"
        style={{ display: 'flex', justifyContent: 'center' }}
      >
        Contact Me
      </Typography>
    </Grid>
  )
}

export default Contact
